import { useState } from "react";

const Home = () => {
  let name = "mario";
  const [nema, setName] = useState(name);
  const handleClick = () => {
    setName((name += "james"));
  };

  return (
    <div className="home">
      <h2>Homepage</h2>
      <p>{name}</p>
      <button onClick={handleClick}>Click me</button>
    </div>
  );
};

export default Home;
